import React from 'react';
import './Category.css';

const Category=(props)=>{
    let DataProductList=props.DataProductList;
    let group=[... new Set(DataProductList.map(x=>x.categoryGroup))];
    return(
        <div className="Category">
            <div className="category-header">Category</div>
            {group.map(x=>(<div className={"category-item "+x+" "+ props.selectedCategory+(x==props.selectedCategory?"selected":"")} key={x} onClick={()=>props.changeCategory(x)}>{x}<span className="downside">{">"}</span></div>))}            
        </div>
    );
}

export default Category;
